import React, { useEffect } from "react"

const Covid =() =>{
    const getCovidData=async ()=>{
        fetch("https://data.covid19india.org/data.json");
    }

    useEffect(()=>{
        getCovidData();

    },[]);




  return(
    <>
    <h1>Covid Tracker</h1>
    </>
  );
};

export default Covid;
